// Function to filter questions by topic
function filterQuestionsByTopic(topicId) {
    filteredQuestions = Questions.filter(question => question.oraliq_dars === topicId);
    currentQuestionIndex = 0;
    selectedAnswer = null;
    correctAnswers = new Array(filteredQuestions.length).fill(false); // Initialize correctAnswers array
    displayQuestion();
    generateTestNavigation(); // Generate test number boxes
}

// Function to display the current question and answers
// Function to display the current question and answers
function displayQuestion() {
    if (!document.body.classList.contains('variant-mode')) {
        document.querySelector("#test-navigation").style.marginTop = "100px";
    }
document.querySelector("#question").style.margin="0";
content.style.display = "block";

    if (filteredQuestions.length === 0) {
        document.getElementById('question').innerText = "No questions available for this topic.";
        document.getElementById('answers').innerHTML = '';
        return;
    }

    const question = filteredQuestions[currentQuestionIndex];
    const questionContainer = document.getElementById('question');
    const questionImage = getCloudinaryImageUrl(question.image ? question.image : 'logo.png');

    const relatedTopic = topic.find(t => t.id === question.oraliq_dars);
    const relatedChapter = relatedTopic ? chapters.find(c => c.id === relatedTopic.oraliq) : null;
    if (russiavalue) {
        questionContainer.innerHTML = `
            <div>${question.question_ru}</div>
            <img src="${questionImage}" alt="Question Image">
        `;
    } else if (cryvalue) {
        questionContainer.innerHTML = `
            <div>${question.question_cry}</div>
            <img src="${questionImage}" alt="Question Image">
        `;
    } else if (uzbvalue) {
        const topicNumber = relatedTopic.name_ru.split('.')[0]; // Extract the number before the dot
        // Replace 4 with 3 for relatedChapter.id, keep other values as is
        const chapterId = relatedChapter && relatedChapter.id === 4 ? 3 : (relatedChapter ? relatedChapter.id : '');
        
        questionContainer.innerHTML = `
            <div>${chapterId}.${topicNumber} ${question.question_uz}</div>
            <img src="${questionImage}" alt="Question Image">
        `;
    }
    const answersContainer = document.getElementById('answers');
    answersContainer.innerHTML = '';

    // Filter answers for the current question
    const filteredAnswers = Answers.filter(answer => answer.oraliq_dars_question === question.id);
    const optionLabels = ['F1', 'F2', 'F3', 'F4', 'F5'];

    filteredAnswers.forEach((answer, index) => {
        const answerElement = document.createElement('div');
        answerElement.className = 'answer';

        // Create span for option label
        const optionSpan = document.createElement('span');
        optionSpan.className = 'option-label';
        optionSpan.innerText = optionLabels[index] || ''; // Assign F1, F2, etc.

        // Create span for answer text
        const textSpan = document.createElement('span');
        if (russiavalue) {
            textSpan.innerText = answer.answer_ru;
        } else if (cryvalue) {
            textSpan.innerText = answer.answer_cry;
        } else {
            textSpan.innerText = answer.answer_uz;
        }

        // Append spans to answer element
        answerElement.appendChild(optionSpan);
        answerElement.appendChild(textSpan);

        // Check if the user has already answered this question
        const userAnswer = userAnswers[currentQuestionIndex];
        if (userAnswer) {
            if (userAnswer.answerId === answer.id) {
                if (userAnswer.isCorrect) {
                    answerElement.classList.add('correct-answer');
                } else {
                    answerElement.classList.add('incorrect-answer');
                }
            }
            if (answer.is_true) {
                answerElement.classList.add('correct-answer'); // Highlight the correct answer
            }
        }

        // Add click event listener only if in test mode and the question hasn't been answered yet
        if (isTestMode && !userAnswers[currentQuestionIndex]) {
            console.log(isTestMode);

            answerElement.addEventListener('click', () => {
                if (!selectedAnswer) {
                    selectedAnswer = answer;
                    document.querySelectorAll('.answer').forEach(a => a.classList.remove('selected'));
                    answerElement.classList.add('selected');
                    checkAnswer(answerElement);
                }
            });
        }
        if (!isTestMode && answer.is_true) {
            answerElement.classList.add('correct-answer');
        }

        answersContainer.appendChild(answerElement);
    });

    // Update navigation buttons
    document.getElementById('prev').disabled = currentQuestionIndex === 0;
    document.getElementById('next').disabled = currentQuestionIndex === filteredQuestions.length - 1;

    // Update test navigation boxes
    updatePercentageDisplay();
    updateTestNavigation();
}
document.addEventListener('keydown', (event) => {
    function updateTestNavigation() {
        if (navContainer) {
            navContainer.innerHTML = ''; // Clear previous navigation boxes
            filteredQuestions.forEach((_, index) => {
                const navBox = document.createElement('div');
                navBox.textContent = index + 1;
                navBox.classList.add('nav-box');
                if (correctAnswers[index] !== undefined) {
                    navBox.classList.add(correctAnswers[index] ? 'correct' : 'incorrect');
                }
                navBox.addEventListener('click', () => {
                    currentQuestionIndex = index;
                    displayQuestion();
                });
                navContainer.appendChild(navBox);
                if (index === currentQuestionIndex) {
                    console.log(index, currentQuestionIndex);

                }
            });
        }
    }
    if (event.key === 'ArrowLeft') {
        prevQuestion(); // Left arrow for previous question
    } else if (event.key === 'ArrowRight') {
        nextQuestion(); // Right arrow for next question
    }
});

