let totalQuestionsAnswered = 0; // Track how many questions have been answered
let totalMistakes = 0; // Track the number of mistakes



function updatePercentageDisplay() {
    const percentage = 100 - ((totalMistakes / totalQuestionsAnswered) * 100);
    const percentageDisplay = document.getElementById('percentageDisplay');
    percentageDisplay.innerText = `Correct Answers: ${percentage.toFixed(2)}%`;

    // Add or remove the 'low-percentage' class based on the percentage
    if (percentage < 90) {
        percentageDisplay.classList.add('low-percentage');
    } else {
        percentageDisplay.classList.remove('low-percentage');
    }
}



function checkAnswer(answerElement) {
    if (selectedAnswer) {
        console.log(selectedAnswer.is_true);
        totalQuestionsAnswered++; // Increment the total questions answered

        // Show the percentage display if it's hidden
        const percentageDisplay = document.getElementById('percentageDisplay');
        if (percentageDisplay.classList.contains('hidden')) {
            percentageDisplay.classList.remove('hidden');
        }

        // Store the user's answer and correctness
        userAnswers[currentQuestionIndex] = {
            answerId: selectedAnswer.id,
            isCorrect: selectedAnswer.is_true
        };

        if (selectedAnswer.is_true) {
            answerElement.classList.add('correct-answer');
            correctAnswers[currentQuestionIndex] = true;
            document.querySelectorAll(".test-box")[currentQuestionIndex].style.background = "green";
        } else {
            answerElement.classList.add('incorrect-answer');
            document.querySelectorAll(".test-box")[currentQuestionIndex].style.background = "red";
            correctAnswers[currentQuestionIndex] = false;
            totalMistakes++; // Increment the number of mistakes

            // Find and highlight the correct answer
            const answersContainer = document.getElementById('answers');
            const allAnswerElements = answersContainer.getElementsByClassName('answer');
            const filteredAnswers = Answers.filter(answer => answer.oraliq_dars_question === filteredQuestions[currentQuestionIndex].id);

            filteredAnswers.forEach((answer, index) => {
                if (answer.is_true) {
                    allAnswerElements[index].classList.add('correct-answer'); // Highlight the correct answer
                }
            });
        }
        setTimeout(() => {
            nextQuestion();
        }, 3000);
        updatePercentageDisplay(); // Call the globally defined function
        updateTestNavigation();
    }
}
let variantlar = document.querySelector(".variant");

