    // Shuffle the newQuestionsArray randomly
    function shuffleArray(array) {
        for (let i = array.length - 1; i > 0; i--) {
            const j = Math.floor(Math.random() * (i + 1));
            [array[i], array[j]] = [array[j], array[i]]; // Swap elements
        }
    }

    // Process the questions and shuffle them
    const newQuestionsArray = Questions.map(question => {
        const relatedAnswers = Answers.filter(answer => answer.oraliq_dars_question === question.id);
        const relatedTopic = topic.find(topic => topic.id === question.oraliq_dars);
        const relatedChapter = chapters.find(chapter => chapter.id === relatedTopic.oraliq);

        // Adjust chapter id if it is 4
        const adjustedChapterId = relatedChapter.id === 4 ? 3 : relatedChapter.id;

        return {
            ...question,
            answers: relatedAnswers,
            topic: relatedTopic,
            chapter: { ...relatedChapter, id: adjustedChapterId }
        };
    });

    // Shuffle the newQuestionsArray before grouping
    shuffleArray(newQuestionsArray);

    // Group the shuffled questions into 20 groups
    function groupQuestions(questionsArray, groupSize) {
        const groups = [];
        for (let i = 0; i < questionsArray.length; i += groupSize) {
            groups.push(questionsArray.slice(i, i + groupSize));
        }
        return groups;
    }

    // Now group the shuffled questions into 20 groups
    const groupedQuestions = groupQuestions(newQuestionsArray, 20);

    console.log(groupedQuestions);

    const buttonContainer = document.createElement('div');
    buttonContainer.classList.add('button-container-group');
    groupedQuestions.forEach((group, index) => {
        const button = document.createElement('button');
        button.textContent = `Variant ${index + 1}`;
        button.classList.add('group-button');
        button.addEventListener('click', () => {
            document.body.classList.add('variant-mode');
            const testNav = document.querySelector("#test-navigation");
            if (testNav) testNav.style.marginTop = "";
            currentQuestionIndex = 0;
            displayGroupQuestions(group);
            document.querySelector(".button-container-group").style.display = "none";
            mainitems.style.display = "none";
            content.style.position = "relative";
        });
        buttonContainer.appendChild(button);
    });
    document.body.appendChild(buttonContainer);

    function displayGroupQuestions(group) {
        filteredQuestions = group;
        displayQuestion();
        generateTestNavigation();
        startTimer(25 * 60); // Start 25-minute timer
    }

